import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

function Footer() {
  return (
    <Row className="text-center  py-4 text-secondary ">
    

        <Col>
          <div className="d-flex flex-column">
            <strong className="text-success">Contacts</strong>
            <span>customer care: 07-4321</span>
            <span>chat with customercare</span>
            <span>email: weezybalo@gmail.com</span>
          </div>
        </Col>
        <Col >
          <div className="d-flex flex-column">
            <strong className="text-success">Report a problem</strong>
            <span>file a refund</span>
            <span>settings & privacy</span>
            <span>terms and conditions</span>
          </div>
        </Col>
     
    </Row>
  );
}

export default Footer;
